gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport time\nfrom dask_interface import Initialization\nfrom  dask_interface import CoupleDask\nimport numpy as np\nimport pandas as pd\nimport yaml\nimport dask.array as da\nfrom dask.distributed import performance_report\nfrom dask_ml.decomposition import IncrementalPCA\n\n\nwith open(r'config.yml') as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    Ssize = data[\"parallelism\"][\"height\"]*data[\"parallelism\"][\"width\"]\n    generations = data[\"MaxtimeSteps\"]\n    Sworkers = data[\"workers\"]\n    timeStep = 1\nC = Initialization(Ssize, Sworkers)\nC.client.get_versions(check=True)\n\n\n# Results \nResults = []\n\n# perf holds different time measurements \n# generation, getdata, get-from-queues, computation \nperf = np.empty([generations//timeStep, 4])\nt = time.perf_counter()\nprint(\"Je suis vivant \", flush=True)\n\nwith performance_report(filename=\"dask-report.html\"):\n    for g in range(0, generations, timeStep):\n        tic3 = time.perf_counter()\n        tic = time.perf_counter()\n        arrays, perf[g//timeStep][2] = C.get_data()\n        arrays = da.reshape(arrays, (arrays.shape[1],arrays.shape[2])) \n        toc = time.perf_counter()\n        perf[g//timeStep][1] = toc - tic\n        tic1 = time.perf_counter()\n        if g==0:\n            pca=IncrementalPCA(n_components=2,copy=False, svd_solver='randomized')\n            pca.partial_fit(arrays)\n        else:\n           pca.partial_fit(arrays)\n\n        arrays=None\n        toc1 = time.perf_counter()\n        perf[g//timeStep][3] = toc1 - tic1  \n        toc3 = time.perf_counter()\n        perf[g//timeStep][0] = toc3 - tic3\n\n\n\nprint(\"pca, \", pca, flush=True)\nResults.append([pca.explained_variance_ , pca.singular_values_])\ntp = time.perf_counter()\nprint(\"Total time to Dask solution is \", tp-t)\n\npperf = pd.DataFrame(perf,columns=['generation', 'getdata', 'getdataq', 'computation'])\npdata = pd.DataFrame(Results,columns=[ 'his', 'bins'])\n\nwith open(\"perf.csv\", \"a\") as fperf:\n    pperf.to_csv(fperf, encoding='utf-8', index=False)\n    \nwith open(\"diag.csv\", \"a\") as fdiag:\n    pdata.to_csv(fdiag, encoding='utf-8', index=False)\n    \nC.Finalization()\n    \n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"line_color":"red","x":{"field":"time"},"y":{"field":"read_bytes"}},"id":"1308","type":"Line"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"coordinates":null,"group":null},"id":"1415","type":"Title"},{"attributes":{"line_alpha":0.2,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"cpu"}},"id":"1244","type":"Line"},{"attributes":{},"id":"1164","type":"CategoricalTicker"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{},"id":"1376","type":"LinearScale"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{"coordinates":null,"data_source":{"id":"1002"},"glyph":{"id":"1031"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1033"},"nonselection_glyph":null,"selection_glyph":null,"view":{"id":"1035"}},"id":"1034","type":"GlyphRenderer"},{"attributes":{"start":0},"id":"1253","type":"DataRange1d"},{"attributes":{},"id":"1374","type":"LinearScale"},{"attributes":{"mantissas":[1,2,5],"max_interval":500.0,"num_minor_ticks":0},"id":"1550","type":"AdaptiveTicker"},{"attributes":{"axis":{"id":"1163"},"coordinates":null,"group":null,"ticker":null},"id":"1165","type":"Grid"},{"attributes":{"line_alpha":0.1,"line_color":"red","x":{"field":"time"},"y":{"field":"read_bytes"}},"id":"1309","type":"Line"},{"attributes":{"coordinates":null,"formatter":{"id":"1451"},"group":null,"major_label_orientation":-0.3490658503988659,"major_label_policy":{"id":"1452"},"ticker":{"id":"1164"}},"id":"1163","type":"Ca
